	(2,1,1,1,1,'新闻20分','https://p1.ssl.qhmsg.com/dmtfd/654_654_/t0142dfbb95d5a479da.jpg',NULL,'2009年9月28日，CCTV-1 HD(中央电视台第一套节目-高清)开播，《新闻20分》同《新闻联播》、《晚间新闻》改至高清229演播室，演播室内节目采用16:9高清信号播出。2010年7月12日，为了解决综合频道节目重新编排后节目资源过剩的问题，《新闻20分》已于当日停播。',0,0,'2019-03-18 22:31:09','2019-03-18 22:31:09',0,NULL),
	(3,1,1,2,1,'315晚会点名电子烟','http://cms-bucket.ws.126.net/2019/03/16/08e7c3e294024b53800ac6d1193872ad.png',NULL,'IT之家3月15日消息 今天，央视315晚会曝光电子烟也会释放有害物质，危害吸烟者和被动吸烟人群健康，长时间吸食电子烟同样会产生对尼古丁的依赖。通过对相关电商平台的检索IT之家发现，电子烟产品已经被京东、苏宁易购下架',0,0,'2019-03-18 22:36:03','2019-03-18 22:36:03',0,NULL),
	(4,2,1,2,1,'雄安新区基础设施和重点项目建设已相继展开','http://cms-bucket.ws.126.net/2019/03/16/08e7c3e294024b53800ac6d1193872ad.png',NULL,'河北雄安新区规划建设领导小组召开会议，会议指出，我们的最高领导人对雄安新区广大群众的生产生活高度重视、非常关心，作出了一系列重要指示。当前雄安新区各项规划编制已经进入关键阶段，基础设施和重点项目建设相继展开。要全力以赴抓好雄安新区规划建设各项工作。',0,0,'2019-03-25 21:55:27','2019-03-25 21:55:27',0,NULL),
	(5,2,1,3,1,'每天就知道屏幕上看新闻图片的人，智商真得会因此而降低吗','http://gastatic.appasd.com/gaqn/id/201902241547300.jpg',NULL,'事实上，一种有趣生活的取得，并不在于你究竟拥有外在多少东西，而看你的思维是否丰盈与鲜活。没有这一点作为保证，不论一个人的名气有多大，身上的光环有多耀眼，当潮水退去后，显出原形的他一样是具只能裸泳的臭行囊。',0,0,'2019-03-25 21:57:35','2019-03-25 21:57:35',0,NULL);
